  return (
    <div className="App">
      <header className="App-header">
        <Header/>
        <Banner/>
        <div>
          <h1>Welcome to My Europe Travel Journal</h1>
          <h3>Izzy Huang</h3>
          <AlbumMaker/>
        </div>
      </header>
    </div>
  );
}

export default App;
